//Report
CREATE OR REPLACE VIEW SDG_1_4_2_Report_View_2000_all AS
WITH report_data AS (
    SELECT *
    FROM SDG_1_4_2_Report('2000-01-01 00:00:00', '2001-01-01 00:00:00', (SELECT geom FROM test_area WHERE id = 1))
)
SELECT 
    report_begindate,
    report_enddate,
    report_region,
    report_category,
    CASE
        WHEN report_category = 'gender' THEN hst.hst_description
        WHEN report_category = 'tenure_type' THEN rt.rt_description
        ELSE report_subcategory
    END AS report_subcategory,
    report_totalAdultsCount,
    report_proportionPerceivingSecurity,
    report_proportionWithLegalDocumentation
FROM 
    report_data r
LEFT JOIN 
    la_humansexestype hst ON CAST(hst.hst_id AS TEXT) = r.report_subcategory AND r.report_category = 'gender'
LEFT JOIN 
    la_righttype rt ON CAST(rt.rt_id AS TEXT) = r.report_subcategory AND r.report_category = 'tenure_type';

SELECT * FROM SDG_1_4_2_Report_View_2000_all;


